        [TestCleanup()]
        public void TestCleanup()
        {
            // clean data
            _MockRisProContext.Patients.ToList().ForEach(p => _MockRisProContext.Patients.Remove(p));
            _MockRisProContext.Orders.ToList().ForEach(o => _MockRisProContext.Orders.Remove(o));
            _MockRisProContext.Procedures.ToList().ForEach(p => _MockRisProContext.Procedures.Remove(p));
            _MockRisProContext.Reports.ToList().ForEach(p => _MockRisProContext.Reports.Remove(p));
            _MockRisProContext.Users.ToList().ForEach(u => _MockRisProContext.Users.Remove(u));
            _MockRisProContext.AccessionNumberLists.ToList().ForEach(u => _MockRisProContext.AccessionNumberLists.Remove(u));
            _MockRisProContext.BodySystemMaps.ToList().ForEach(u => _MockRisProContext.BodySystemMaps.Remove(u));
        }

