        [TestMethod]
        public void GetPatientProceduresTest()
        {
            var patientProcedures = _registrationService.GetProcedures(_patientId).Cast<dynamic>().ToList();
            Assert.AreEqual(1, patientProcedures.Count);
            var procedure = (object)patientProcedures[0];
            var t = procedure.GetType();
            Assert.AreEqual("000001", t.GetProperty("AccNo").GetValue(procedure, null));
            Assert.AreEqual("CR", t.GetProperty("ModalityType").GetValue(procedure, null));
            Assert.AreEqual("User1", t.GetProperty("Registrar").GetValue(procedure, null));
            Assert.AreEqual("WYGText1", t.GetProperty("WYGText").GetValue(procedure, null));
            Assert.AreEqual("WYSText1", t.GetProperty("WYSText").GetValue(procedure, null));
        }

